import { BrowserRouter, Route, Routes } from "react-router-dom";
import HomePage from "../page/home";
import CartPage from "../page/cart";
import BookDetailPage from "../page/bookdetail";

export default function AppRouter({book,setBook}) {
    return (
    <BrowserRouter>
        <Routes>
            <Route index element={<HomePage book={book} setBook={setBook}/>} />
            <Route path="/cart" element={<CartPage cartbook={book} setCartbook={setBook}/>} />
            <Route path="/book/:id" element={<BookDetailPage books={book}/>} />
        </Routes>
    </BrowserRouter>
    );
}
